/* ==================================================
   Next Section
================================================== */
TECKNO.goSection = function(){
	$('.nextsection').on('click', function(){
		$target = $($(this).attr('href')).offset().top;
		$('body, html').animate({scrollTop : $target}, 600, 'easeOutExpo');
		return false;
	});
}

/* ==================================================
   GoUp
================================================== */
TECKNO.goUp = function(){
	$('#goUp').on('click', function(){
		$target = $($(this).attr('href')).offset().top;

		$('body, html').animate({scrollTop : $target}, 600, 'easeOutExpo');
		return false;
	});
}

/* ==================================================
	Scroll to Top
================================================== */
TECKNO.scrollToNextPage = function(){
	var windowWidth = $(window).width(),
		didScroll = false;

	var $arrow = $('#next-page');

	$arrow.click(function(e) {
		$('body,html').animate({ scrollTop: "0" }, 600, 'easeOutExpo' );
		e.preventDefault();
	})

	$(window).scroll(function() {
		didScroll = true;
	});

	setInterval(function() {
		if( didScroll ) {
			didScroll = false;

			if( $(window).scrollTop() > 1000 ) {
				$arrow.css('display', 'block');
			} else {
				$arrow.css('display', 'none');
			}
		}
	}, 250);
}

/* ==================================================
	Scroll to Top
================================================== */

TECKNO.scrollToTop = function(){
	var windowWidth = $(window).width(),
		didScroll = false;

	var $arrow = $('#back-to-top');

	$arrow.click(function(e) {
		$('body,html').animate({ scrollTop: "0" }, 600, 'easeOutExpo' );
		e.preventDefault();
	})

	$(window).scroll(function() {
		didScroll = true;
	});

	setInterval(function() {
		if( didScroll ) {
			didScroll = false;

			if( $(window).scrollTop() > 1000 ) {
				$arrow.css('display', 'block');
			} else {
				$arrow.css('display', 'none');
			}
		}
	}, 250);
}

/* ==================================================
   Thumbs / Social Effects
================================================== */

// Fix Hover on Touch Devices
TECKNO.utils = function(){
	$('.item-thumbs, .box-value, .capabilities-box, #social ul li a').bind('touchstart', function(){
		$(".active").removeClass("active");
      	$(this).addClass('active');
    });
}


/* ==================================================
   Tooltip
================================================== */

TECKNO.toolTip = function(){
    $('a[data-toggle=tooltip]').tooltip();
}

